	function zoomBoxVerticalAlign(){
		jQuery('body:not(.style-simple) .zoom_box').each(function(){
			
            var el = jQuery(this);
            var elH = el.height(); 
            var desc = el.find('.desc_wrap');
            var descH = desc.height(); 
            
            var padding = ( elH - descH ) / 2;
            
            desc.css( 'padding-top', padding +'px' );

        });
	}
	zoomBoxVerticalAlign();
		
			/* ---------------------------------------------------------------------------
		 * Iframe height
		 * --------------------------------------------------------------------------- */		
		function iframeHeight( item, ratio ){
			var itemW = item.width();
			var itemH = itemW * ratio;
			if( itemH < 147 ) itemH = 147;
			item.height(itemH);
		}
		
		function iframesHeight(){
			iframeHeight(jQuery(".blog_wrapper .post-photo-wrapper .mfn-jplayer, .blog_wrapper .post-photo-wrapper iframe, .post-related .mfn-jplayer, .post-related iframe, .blog_slider_ul .mfn-jplayer, .blog_slider_ul iframe"), 0.78);	// blog - list			
			iframeHeight(jQuery(".single-post .single-photo-wrapper .mfn-jplayer, .single-post .single-photo-wrapper iframe" ), 0.4);	// blog - single
			
			iframeHeight(jQuery(".section-portfolio-header .mfn-jplayer, .section-portfolio-header iframe" ), 0.4);	// portfolio - single
		}
		iframesHeight();
		
	
    /* ---------------------------------------------------------------------------
	 * Sticky header
	 * --------------------------------------------------------------------------- */
    var topBarTop = '61px';
    var mfn_header_height = 0;
    
    // header height
    function mfn_stickyH(){
    	if( jQuery('body').hasClass('header-below') ){
	    	// header below slider
	    	mfn_header_height = jQuery('.mfn-main-slider').innerHeight() + jQuery('#Header').innerHeight();
	    } else {
	    	// default
	    	mfn_header_height = jQuery('#Top_bar').innerHeight() + jQuery('#Action_bar').innerHeight();
	    }
    }
    
    // init
	function mfn_sticky(){
		if( jQuery('body').hasClass('sticky-header') ){	
			var start_y = mfn_header_height;
			var window_y = jQuery(window).scrollTop();
	
			if( window_y > start_y ){
				if( ! (jQuery('#Top_bar').hasClass('is-sticky'))){
					
					jQuery('.header-classic .header_placeholder').css('height', jQuery('#Top_bar').innerHeight() - jQuery('#Action_bar').innerHeight());
					jQuery('.header-stack   .header_placeholder').css('height', 71);
					jQuery('.header-below   .header_placeholder').css('height', jQuery('#Top_bar').innerHeight());
					jQuery('.minimalist-header .header_placeholder').css('height', jQuery('#Top_bar').innerHeight());
					
					jQuery('#Top_bar')
						.addClass('is-sticky')
						.css('top',-60)
						.animate({
							'top': jQuery('#wpadminbar').innerHeight()
						},300);
				}
			}
			else {
				if(jQuery('#Top_bar').hasClass('is-sticky')) {
					jQuery('.header_placeholder').css('height',0);
					jQuery('#Top_bar')
						.removeClass('is-sticky')
						.css('top', topBarTop);
				}	
			}
		}
	}
	
	
	/* ---------------------------------------------------------------------------
	 * Sidebar height
	 * --------------------------------------------------------------------------- */
	function mfn_sidebar(){
		if( jQuery('.with_aside .four.columns').length ){
			var maxH = jQuery('#Content .sections_group').height() - 20
			jQuery('.with_aside .four.columns .widget-area').each(function(){
				jQuery(this).css( 'min-height', 0 );
				if( jQuery(this).height() > maxH ){
					maxH = jQuery(this).height();
				}
			});
			jQuery('.with_aside .four.columns .widget-area').css( 'min-height', maxH + 'px' );
		}
	}
	
	
		/* ---------------------------------------------------------------------------
		 * Overlay menu
		 * --------------------------------------------------------------------------- */
		jQuery('.overlay-menu-toggle').click(function(e){
			e.preventDefault();
			
			jQuery(this).toggleClass('focus');
			jQuery('#Overlay').stop(true,true).fadeToggle(500);
			
			var menuH = jQuery('#Overlay nav').height() / 2;
			jQuery('#Overlay nav').css( 'margin-top', '-' + menuH + 'px' );	
		});
		
	/* ---------------------------------------------------------------------------
	 * Sliding Footer | Height
	 * --------------------------------------------------------------------------- */
	function mfn_footer(){
		if( jQuery('.footer-fixed #Footer, .footer-sliding #Footer').length ){
			var footerH = jQuery('#Footer').height();
			jQuery('#Content').css( 'margin-bottom', footerH + 'px' );
		}
	}
	
	
	/* ---------------------------------------------------------------------------
	 * Header width
	 * --------------------------------------------------------------------------- */
	function mfn_header(){
		var rightW = jQuery('.top_bar_right').innerWidth();
		var parentW = jQuery('#Top_bar .one').innerWidth() - 10;
		var leftW = parentW - rightW;
		jQuery('.top_bar_left, .menu > li > ul.mfn-megamenu ').width( leftW );
	}
	
	
	/* ---------------------------------------------------------------------------
	 * Full Screen Section
	 * --------------------------------------------------------------------------- */
	function mfn_sectionH(){
		var windowH = jQuery(window).height();
		jQuery('.section.full-screen').each(function(){
			var section = jQuery(this);
			var wrapper = jQuery('.section_wrapper',section);
			section
				.css('padding', 0)
				.height( windowH );
			var padding = ( windowH - wrapper.height() ) / 2;
			wrapper.css('padding-top', padding + 20);			// 20 = column margin-bottom / 2
		});
	}
	
	
	/* ---------------------------------------------------------------------------
	 * # Hash smooth navigation
	 * --------------------------------------------------------------------------- */
	function hashNav(){
		
		// # window.location.hash
		var hash = window.location.hash;
		
		if( hash && jQuery(hash).length ){	
			
			var stickyH = jQuery('.sticky-header #Top_bar').innerHeight();
			var tabsHeaderH = jQuery(hash).siblings('.ui-tabs-nav').innerHeight();
			
			jQuery('html, body').animate({ 
				scrollTop: jQuery(hash).offset().top - stickyH - tabsHeaderH
			}, 500);
		}
	}
	
	
	/* ---------------------------------------------------------------------------
	 * One Page | Scroll Active
	 * --------------------------------------------------------------------------- */
	function onePageActive(){
		if( jQuery('body').hasClass('one-page') ){
			
			var stickyH = jQuery('.sticky-header #Top_bar').innerHeight();
	
			var winTop = jQuery(window).scrollTop();
			var offset = stickyH + 1; // offset top
	
	        var visible = jQuery('[data-id]').filter(function(ndx, div){
	            return winTop >= jQuery(div).offset().top - offset &&
	            winTop < jQuery(div).offset().top - offset + jQuery(div).outerHeight()
	        });
	        
	        var newActive = visible.first().attr('id');        
	        var active = '[data-hash="#'+ newActive +'"]';
	        
	        if( newActive ){
		        var menu = jQuery('#menu');
		        menu.find('li').removeClass('current-menu-item currenet-menu-parent current-menu-ancestor current_page_item current_page_parent current_page_ancestor');
		        jQuery( active, menu ).closest('li').addClass('current-menu-item');
	        }
	        
		}
	}
	
	
	/* ---------------------------------------------------------------------------
	 * niceScroll | Padding right fix for short content
	 * --------------------------------------------------------------------------- */
	function niceScrollFix(){ 
		var el = jQuery('body > .nicescroll-rails');
		if( el.length ){
			if( el.is(":visible") ){
				jQuery('body').addClass('nice-scroll');
			} else {
				jQuery('body').removeClass('nice-scroll');
			}
		}
	}

	
